    // }, []); 



  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>번호</th>
            <th>제목</th>
            <th>작성자</th>
            <th>내용</th>
          </tr>
        </thead>
        <tbody>

        {
        data.map((a, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{a.title}</td>
              <td>{a.who}</td>
              <td>{a.content}</td>
            </tr>
          ))}

        </tbody>
      </Table>
      <Button variant="info">글쓰기</Button>
      <Button variant="secondary">수정하기</Button>
      <Button variant="danger">삭제하기</Button>
    </div>
  );
}

export default List;
